import React from 'react';
import 'bootstrap/dist/css/bootstrap.min.css';
import { Card, CardTitle, Col, Row, CardText } from 'reactstrap';

export default function Resultado(props) {
    // Obtener el resultado según el valor actual del contador utilizando la función proporcionada
    const resultado = props.obtenerResultado(props.contador);

    return (
        <Row>
            <Col sm="6">
                <Card body>
                    <CardTitle tag="h5">{props.contador}{resultado.tipo}</CardTitle>
                    <CardText>{resultado.descripcion}</CardText>
                </Card>
            </Col>
        </Row>
    );
}
